package week1.day1;

public class Factorial {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		 int fact=1;  
		   
		  for(int i=1;i<=5;i++){    
		      fact=fact*i;    
		  }    
		  System.out.println("Output: 5*4*3*2*1 = "+fact);    
		 }  
		

	}


